export default function Footer() {
  return (
    <div>
      <div className="footer">Created By Welid Labidi</div>
      <style jsx>{`
        .footer {
          position:fixed
          text-align: center;
          display:flex;
          justify-content:center
          margin-top: 70px;
          color: rgb(155, 152, 152);
        }
      `}</style>
    </div>
  );
}
